import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <div>
      <nav className="footernav">
        <p className="address">
          Wallawaya Road,
          <br />
          <br />
          Pillewela,
          <br />
          <br />
          Buttala
          <br/>
          071 327 5308
        </p>
        <form>
            <label>Nilan</label>
        </form>
      </nav>
    </div>
  );
}

export default Footer;
